{
  "ubx_message": {
    "name": "UBX-RXM-COR",
    "class_id": "0x02",
    "message_id": "0x34",
    "message_type": "output",
    "description": "Differential correction input status",
    "payload_length": {
      "fixed": 12
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x01 for this version)",
        "fixed_value": 1
      },
      {
        "byte_offset": 1,
        "data_type": "U1",
        "name": "ebno",
        "scale": {
          "raw": "2^-3",
          "multiplier": 0.125
        },
        "unit": "dB",
        "description": "Energy per bit to noise power spectral density ratio (Eb/NO). 0: unknown. Reported only for protocol UBX-RXM-PMP (SPARTN) to monitor signal quality."
      },
      {
        "byte_offset": 2,
        "data_type": "U1",
        "name": "reserved0",
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 3,
        "data_type": "U1",
        "name": "reserved1",
        "reserved": true,
        "description": "Reserved"
      },
      {
        "byte_offset": 4,
        "data_type": "X4",
        "name": "statusInfo",
        "description": "Message input status information",
        "sub_fields": [
          {
            "bits_from": 0,
            "bits_to": 4,
            "data_type": "U:5",
            "name": "protocol",
            "description": "Input correction data protocol:",
            "value_descriptions": [
              {
                "value": 0,
                "description": "Unknown"
              },
              {
                "value": 1,
                "description": "RTCM3"
              },
              {
                "value": 2,
                "description": "SPARTN (Secure Position Augmentation for Real Time Navigation)"
              },
              {
                "value": 29,
                "description": "UBX-RXM-PMP (SPARTN)"
              },
              {
                "value": 30,
                "description": "UBX-RXM-QZSSL6"
              }
            ]
          },
          {
            "bits_from": 5,
            "bits_to": 6,
            "data_type": "U:2",
            "name": "errStatus",
            "description": "Error status of the received correction message content based on possibly available error codes or checksums:",
            "value_descriptions": [
              {
                "value": 0,
                "description": "Unknown"
              },
              {
                "value": 1,
                "description": "Error-free"
              },
              {
                "value": 2,
                "description": "Erroneous"
              }
            ]
          },
          {
            "bits_from": 7,
            "bits_to": 8,
            "data_type": "U:2",
            "name": "msgUsed",
            "description": "Status of receiver using the input message:",
            "value_descriptions": [
              {
                "value": 0,
                "description": "Unknown"
              },
              {
                "value": 1,
                "description": "Not used"
              },
              {
                "value": 2,
                "description": "Used"
              }
            ]
          },
          {
            "bits_from": 9,
            "bits_to": 24,
            "data_type": "U:16",
            "name": "correctionId",
            "description": "Identifier for the correction stream: For RTCM 3: Reference station ID (DF003) of the received RTCM input message. Valid range 0-4095. Reported only for the standard RTCM messages that include the DF003 field and for the u-blox proprietary RTCM messages 4072.x. For all other messages, reports 0xFFFF. For other correction protocols 0xFFFF."
          },
          {
            "bits_from": 25,
            "bits_to": 25,
            "data_type": "U:1",
            "name": "msgTypeValid",
            "description": "Validity of the msgType field. Set to False e.g. if the protocol does not define msgType."
          },
          {
            "bits_from": 26,
            "bits_to": 26,
            "data_type": "U:1",
            "name": "msgSubTypeValid",
            "description": "Validity of the msgSubType field. Set to False e.g. if the protocol does not define subtype for the msgType."
          },
          {
            "bits_from": 27,
            "bits_to": 27,
            "data_type": "U:1",
            "name": "msgInputHandle",
            "description": "Input handling support of the input message: 0: Receiver does not have input handling support for this message. 1: Receiver has input handling support for this message. Input handling support does not necessarily mean that message is supported/used by the receiver."
          },
          {
            "bits_from": 28,
            "bits_to": 29,
            "data_type": "U:2",
            "name": "msgEncrypted",
            "description": "Encryption status of the input message:",
            "value_descriptions": [
              {
                "value": 0,
                "description": "Unknown"
              },
              {
                "value": 1,
                "description": "Not encrypted"
              },
              {
                "value": 2,
                "description": "Encrypted"
              }
            ]
          },
          {
            "bits_from": 30,
            "bits_to": 31,
            "data_type": "U:2",
            "name": "msgDecrypted",
            "description": "Decryption status of the input message:",
            "value_descriptions": [
              {
                "value": 0,
                "description": "Unknown"
              },
              {
                "value": 1,
                "description": "Not decrypted"
              },
              {
                "value": 2,
                "description": "Decrypted"
              }
            ]
          }
        ]
      },
      {
        "byte_offset": 8,
        "data_type": "U2",
        "name": "msgType",
        "description": "Message type"
      },
      {
        "byte_offset": 10,
        "data_type": "U2",
        "name": "msgSubType",
        "description": "Message subtype"
      }
    ]
  }
}
